function App() {

  const [password, setPassword] = useState('PASSWORD')

  return (
    <div className='flex justify-center space-y-8 items-center h-screen w-[430px] m-auto flex-col'>
      <Header />
      <Display />
      <InteractiveWindow />
    </div>
  );
}

export default App;
